import React from 'react';

function Text() {
    return (
        // <p>Grapic and web design are far more than a job</p>
        <form>
            <label>
                Name:
                <input type="text" name="name" />
            </label>
            <input type="submit" value="Submit" />
        </form>
    );
}

export default Text;
